drop table if exists w7_order_item
drop table if exists w7_order
drop table if exists w7_product
drop table if exists w7_customer

create table w7_customer (
	customer_id int identity primary key
	, customer_name varchar(50) not null
)

create table w7_product (
	product_id int identity primary key
	, product_name varchar(50) not null
	, list_price decimal(19, 4)
)

create table w7_order (
	order_id int identity primary key
	, order_date datetime not null default getdate()
	, customer_id int not null foreign key references w7_customer(customer_id)
)

create table w7_order_item (
	order_item_id int identity primary key
	, order_id int not null foreign key references w7_order(order_id)
	, product_id int not null foreign key references w7_product(product_id)
	, quantity_ordered int not null default 1
	, price decimal(19, 4) not null default 1.0
)

select * from w7_customer


select * from w7_product

select * from w7_order


select * from w7_order_item